fn extract_document_ids(doc: &str) -> Vec<String> {
    let mut ids = Vec::new();
    let bytes = doc.as_bytes();
    let mut i = 0usize;

    while i + 10 <= bytes.len() {
        if bytes[i] == b'A' && bytes[i + 1] == b'C' && bytes[i + 2] == b'-' {
            let mut j = i + 3;
            while j < bytes.len() && bytes[j].is_ascii_uppercase() {
                j += 1;
            }

            if j < bytes.len() && bytes[j] == b'-' && j + 4 <= bytes.len() {
                let k = j + 1;
                if bytes[k..k + 3].iter().all(u8::is_ascii_digit) {
                    let id = &doc[i..k + 3];
                    ids.push(id.to_string());
                    i = k + 3;
                    continue;
                }
            }
        }
        i += 1;
    }

    ids.sort();
    ids.dedup();
    ids
}

fn expected_ids() -> Vec<String> {
    EXPECTED_IDS
        .iter()
        .map(|id| id.to_string())
        .collect::<Vec<_>>()
}

fn expected_ids_by_prefix(prefix: &str) -> Vec<String> {
    EXPECTED_IDS
        .iter()
        .filter(|id| id.starts_with(prefix))
        .map(|id| id.to_string())
        .collect::<Vec<_>>()
}

#[test]
fn generated_id_list_matches_acceptance_document() {
    assert_eq!(
        extract_document_ids(ACCEPTANCE_DOC),
        expected_ids(),
        "regenerate acceptance tests after AC document updates"
    );
}

#[test]
fn runtime_stub_ids_match_acceptance_document() {
    assert_eq!(
        extract_document_ids(ALL_RUNTIME_STUBS),
        expected_ids(),
        "ac_runtime_stubs_generated.rs must cover every AC id"
    );
}

