fn ac_tst_runtime_stub_ids_match_acceptance_document() {
    assert_eq!(
        extract_document_ids(TST_RUNTIME_STUBS),
        expected_ids_by_prefix("AC-TST-"),
        "ac_tst_runtime_stubs.rs must cover every AC-TST id"
    );
}

